import image1 from './image1.png'
import './App.css';

function Header() {
  return (
    <img src={image1} className="image1" alt="image1" width={60} />
  )
}

function Maincontent() {
  return (
    <div>
      <h1>Fun facts about React</h1>
      <ul>
      <li>Was first released in 2013</li>
      <li>Was originally creadted by Jordan Walke</li>
      <li>Has well over 100k stars on GitHub</li>
      <li>Is maintained by Facebook</li>
      <li>Powers thousands of enterprise apps, including mobile apps</li>
      </ul>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Header />
      <Maincontent />
      <footer>
      <small>Â© 2023 Dannyswiss development. All rights reserved.</small>
      </footer>


    </div>
  );
}

export default App;
